import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import libary from '../image/Camera Roll/lb.png';
import libary_q from '../image/Camera Roll/lb2.png';


const Project = () => {
  return (
    <div>
       <div class="container">

      <div class="row">
        <div class="col-sm-12">
          <div id="carousel-notification" class="bootstrap-carousel" data-indicators="true" data-controls="true">
            <img src={libary} data-title="doge" data-content="Hey there!"/>
            <img src={libary_q} data-title="laika" data-content="Hey ...!"/>

          </div>
        </div>
      </div>

    </div>

    <script src="https://ajax.googleapis.com/ajax/libs/jquery/1.12.0/jquery.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.6/js/bootstrap.min.js" integrity="sha384-0mSbJDEHialfmuBBQP6A4Qrprq5OVfW37PRR3j5ELqxss1yVqOtnepnHVP9aJ7xS" crossorigin="anonymous"></script>
    <script src="bootstrap-carousel.js"></script>
    </div>


  )
}

export default Project;
